import React, { Component } from "react";
import { BrowserRouter, Switch, Route, HashRouter as Router } from "react-router-dom";


import Nawigacja from "./components/Nawigacja";
import About from "./components/NasiKlienci";
import "materialize-css";
import Home from "./components/Home";
import Contact from "./components/Contact";
import NawigacjaTelefon from "./components/NawigacjaTelefon"; 
import Galeria from "./components/Galeria";
import Kariera from "./components/Kariera";
import Zamow from "./components/Zamow";
import { Footer } from "react-materialize";
import Certyfikaty from "./components/Certyfikaty";
import NaszeRealizacje from "./components/NaszeRealizacje";
import NasiKlienci from "./components/NasiKlienci";
import ONas from "./components/ONas";
import Kontrahenci from "./components/Kontrahenci";
import System from "./components/System";
import Dodatki from "./components/Dodatki";
import DachPlaski from "./components/Houses.jsx/DachPlaski";
import DachDwuspadowyQ from "./components/Houses.jsx/DachDwuspadowy";
import DachDwuspadowyM from "./components/Houses.jsx/DachDwuspadowyM";
import DachDwuspadowyL from "./components/Houses.jsx/DachDwuspadowyL";
import HouseqMicro from "./components/Houses.jsx/HouseqMicro";
import a35 from "./components/Houses.jsx/DachDwuspadowy35A";
import b35 from "./components/Houses.jsx/DachDwuspadowy35B";
import faq from "./components/faq";
import ReactGA from 'react-ga';
import withTracker from './components/withTracker';



ReactGA.initialize('644-977-0566');
class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Nawigacja />

          {/* <div className="hide-on-large-only">
              <NawigacjaTelefon/>
            </div> */}
          <div className="row" />
          <div className="row">
            <div className="col s12 m12 l12 xl12">
              <Switch>
                {/* ONas = klienci */}
                <Route path="/about" component={withTracker(ONas)} />
                <Route path="/Home" component={withTracker(Home)} />
                <Route path="/contact" component={withTracker(Contact)} />
                <Route path="/faq" component={withTracker(faq)} />
                <Route path="/galeria" component={withTracker(Galeria)} />
                <Route path="/kariera" component={withTracker(Kariera)} />
                <Route path="/zamow" component={withTracker(Zamow)} />
                <Route path="/naszerealizacje" component={withTracker(NaszeRealizacje)} />
                <Route path="/nasiklienci" component={withTracker(NasiKlienci)} />
                <Route path="/certyfikaty" component={withTracker(Certyfikaty)} />
                <Route path="/system" component={withTracker(System)} />
                <Route path="/dachplaski" component={withTracker(DachPlaski)} />
                <Route path="/dachdwuspadowyq" component={withTracker(DachDwuspadowyQ)} />
                <Route path="/dachdwuspadowym" component={withTracker(DachDwuspadowyM)} />
                <Route path="/dachdwuspadowyl" component={withTracker(DachDwuspadowyL)} />
                <Route path="/35a" component={withTracker(a35)} />
                <Route path="/35b" component={withTracker(b35)} />
                <Route path="/micro" component={withTracker(HouseqMicro)} />
                <Route path="/kontrahenci" component={withTracker(Kontrahenci)} />
                <Route path="/dodatki" component={withTracker(Dodatki)} />
                <Route path="/:any" component={withTracker(Home)} />
                <Route path="/" component={withTracker(Home)} />
              </Switch>
            </div>
          </div>
{/* 
          <Footer
            className="footer"
            copyrights="&copy 2020 Copyright Text"
            links={
              <ul>
                <li>
                  <a className="grey-text text-lighten-3" href="#!">
                    Legal1
                  </a>
                </li>
                <li>
                  <a className="grey-text text-lighten-3" href="#!">
                    Legal 2
                  </a>
                </li>
                <li>
                  <a className="grey-text text-lighten-3" href="#!">
                    Link 3
                  </a>
                </li>
                <li>
                  <a className="grey-text text-lighten-3" href="#!">
                    Link 4
                  </a>
                </li>
              </ul>
            }
            moreLinks={
              <a className="grey-text text-lighten-4 right" href="#!">
                More Links
              </a>
            }
          >
            <h5 className="white-text">Footer Content</h5>
            <p className="grey-text text-lighten-4">
              You can use rows and columns here to organize your footer content.
            </p>
          </Footer>*/}
        </div> 
      </BrowserRouter>
    );
  }
}

export default App;
